import React from 'react'
import { createStackNavigator } from '@react-navigation/stack';
import Account from '../Screens/account/Account';

const Stack = createStackNavigator();

const User = () => {
    return (
        <>
            <Stack.Navigator>
                <Stack.Screen name="account" component={Account} />
            </Stack.Navigator>
        </>
    )
}

export default User
